amsterdam The only interesting point is that the 19th century light being wave instead of corpuscular the neat egometrical mythology of the light ray is suddenly transformed into a field of transverse waves emanating everywhere and having nothing especially optic in it:
p. 88 Observer: "Above all, it is a moment when light loses its ontological privilege; and in the course of the 19th century, From faraday to Maxwell, the independent identity of light becomes icnreasingly problematic. (...) More importantly, here however, as light began to be conceived as an electromagnetic phenomenon it had less and less to do with the realm of the visible and with the description of the human vision. So it is at this moment in the early 19th century that physical optics (the study of light and the forms of its operation) merges with physics, and physiological optics (the study of the eye and its sensory capacities) suddenly came to dominate the field of vision".
The great interest became in after-image (Goethe mentions the camera obscura but only to produces after image) the flickering movement allowing for cinema and the stereoscopic images taken as the symbol of the new scopic regime;
